@import '../../styles/index.scss';

:host {
  --button-background-color: var(--secondary);
  --button-text-color: rgba(var(--secondary-text-rgb), 0.8);
  --button-border-radius: var(--spacing-xs);
  --button-border-color: rgba(var(--secondary-border-rgb), 0.5);

  position: relative;
  display: flex;
  flex-direction: column;
  width: 100%;
}

button {
  display: flex;
  align-items: center;
  justify-content: center;

  background: var(--button-background-color);
  border: 1px solid var(--button-border-color);
  border-radius: var(--button-border-radius);
  color: var(--button-text-color);
  padding: 0;
  width: fit-content;

  .label {
    flex: 1;
    font-weight: 700;
  }

  .label,
  .icon {
    @include padding(
      var(--spacing-sm),
      var(--spacing-md),
      var(--spacing-sm),
      var(--spacing-md)
    );
  }

  &:hover {
    --button-text-color: rgba(var(--secondary-text-rgb), 1);
    --button-border-color: rgba(var(--secondary-border-rgb), 1);
    cursor: pointer;
  }

  &.primary {
    --button-background-color: rgba(var(--primary-rgb), 1);
    --button-text-color: var(--primary-text);
    --button-border-color: var(--primary-border);

    &:hover {
      --button-background-color: rgba(var(--primary-rgb), 0.8);
      cursor: pointer;
    }
  }

  &.small {
    .label,
    .icon {
      @include padding(
        var(--spacing-xs),
        var(--spacing-xs),
        var(--spacing-xs),
        var(--spacing-xs)
      );
    }
  }

  &.large {
    .label,
    .icon {
      @include padding(
        var(--spacing-md),
        var(--spacing-lg),
        var(--spacing-md),
        var(--spacing-lg)
      );
    }
  }

  &.block {
    width: 100%;

    .label,
    .icon {
      @include padding(
        var(--spacing-md),
        var(--spacing-lg),
        var(--spacing-md),
        var(--spacing-lg)
      );
    }
  }

  &.text {
    --button-background-color: transparent;
    --button-border-color: transparent;
    --button-text-color: rgba(var(--primary-rgb), 0.8);
  }

  .icon + .label {
    border-left: 1px solid var(--button-border-color);
  }
}

